import Box from '@mui/material/Box';

function Signin(){

    return(

        <Box
      sx={{
        width: 850,
        height: 450,
        backgroundColor: 'primary.dark',
        position:'absolute',
        left:400,
        top:250,
        display:'flex',
        flexDirection:'row'
         }}>
             <Box sx={{
                 width:400,
                 heigth:250,
                 border:'1px solid red',
             }}>

             </Box>
             <Box></Box>
        </Box>
    )

}
export default Signin
